import React from 'react'
import DefaultImage from '../../assets/images/car-image.webp';
const GalleryImage = () => {
  return (
    <div className="relative rounded-[15px] overflow-hidden block transition-all duration-300 cursor-pointer ease">
        <img src={DefaultImage} alt="" className="w-full object-cover rounded-[16px] h-[467px]"/>
        {/* buttons */}
        <div className="opacity-0 invisible transition-all duration-300 ease absolute bottom-[10px] left-0 flex items-center">
            <button></button>
            <button></button>
        </div>
    </div>
  )
}

export default GalleryImage
